import React, { useState, useEffect } from "react";

const FeedbackList = () => {
  const [feedbacks, setFeedbacks] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fetch feedbacks from the backend
    fetch("//feedback/")
      .then((response) => response.json())
      .then((data) => {
        setFeedbacks(data);
        setLoading(false);
      })
      .catch((error) => console.error("Error:", error));
  }, []);

  if (loading) {
    return <p style={{ textAlign: "center" }}>Loading feedback...</p>;
  }

  return (
    <div
      style={{
        maxWidth: "800px",
        margin: "0 auto",
        padding: "20px",
        backgroundColor: "#f9f9f9",
        borderRadius: "8px",
        boxShadow: "0 0 10px rgba(0, 0, 0, 0.1)",
      }}
    >
      <h2 style={{ textAlign: "center", marginBottom: "20px" }}>Feedback Received</h2>
      {feedbacks.length === 0 ? (
        <p style={{ textAlign: "center" }}>No feedback available</p>
      ) : (
        feedbacks.map((feedback) => (
          <div
            key={feedback.id}
            style={{
              borderBottom: "1px solid #ccc",
              padding: "10px",
              marginBottom: "10px",
              borderRadius: "4px",
              backgroundColor: "#fff",
            }}
          >
            <h4 style={{ marginBottom: "5px" }}>{feedback.name}</h4>
            <p style={{ marginBottom: "5px" }}>
              <strong>Email:</strong> {feedback.email}
            </p>
            <p style={{ marginBottom: "5px" }}>
              <strong>Message:</strong> {feedback.message}
            </p>
            <p style={{ fontSize: "12px", color: "gray" }}>
              Submitted on: {new Date(feedback.submitted_at).toLocaleString()}
            </p>
          </div>
        ))
      )}
    </div>
  );
};

export default FeedbackList;
